const Products = () => {
  return <section>
    <h1>The Products page</h1>
    <ul>
      <li><Link to='/products/p1'>Book</Link></li>
      <li> <Link to='/products/p1'>Carpet</Link></li>
      <li><Link to='/products/p3'>An Online Course</Link></li>
    </ul>
  </section>
}

export default Products;
